import './App.css';
import { BroswerRouter as Router, Routes, Route } from 'react-router-dom';

const App = () => {
	return (
		<Router>
			<div className="App">
				<h1>React Router</h1>
			</div>
			<Routes>
				<Route path="/" element={<h1>Hi</h1>} />
			</Routes>
		</Router>
	);
};

export default App;
